<script>
    let arr = [1, 4, 4, 4, 5, 3, 6, 4, 3]
    function migratoryBirds(arr) {
        // Write your code here
        let sortArr = arr.sort()
        let obj = {};
        let maxInt = "";
        for (let i = 0; i < sortArr.length; i++) {
            let key = sortArr[i];
            if (!obj[key]) {
                obj[key] = 0;
            }
            obj[key]++;
            if (maxInt == "" || obj[key] > obj[maxInt]) {
                maxInt = key
            }
        }
        return maxInt



    }
    console.log(migratoryBirds(arr))

</script>
